export default class Home extends Component {
    render() {
        const {obj}=Text
        return (
            <div className="home">
                <AddForm/>
                {
                    obj.filter((item,index)=>item.finished?<Finished item={item} index={index} key={index} /> : <NotFinshed item={item} index={index} key={index} />)
                }
                <Mobx />
            </div>
        )
    }
}
